南方澳城隍廟位於南方澳第二漁港旁，原為大眾廟。在未開港前內埤一帶，以及第一漁港、第二漁港開闢時，均曾挖出先人骸骨，因此在約1955年時在現址興建大眾廟祭祀。經三十餘年後，因年久失修，再於1992-1994年間重建成現貌；同時邀請時任縣長的游錫堃主持晉殿安座大典，且提升大眾爺位階為城隍爺，故將新廟廟名稱「南方澳城隍廟」。 　　此外，南方澳城隍廟旁原有一尊觀音石佛露天安置，即宜蘭西國三十三所觀音靈場中之「第一番　青岸渡寺　如意輪觀世音」；南方澳城隍廟竣工落成後，即將此觀音石佛請入廟中龍邊神龕安奉。

